function run(a){lexer(a)}function parseArguments(a){var b={};return a.length>=2&&(b.source=fs.readFileSync(a[2],"utf8")),b}function parse(a){lines=a.split("\n");for(i=0;i<lines.length;i++){line=lines[i];for(c=0;c<line.length;c++);}return[]}function lexer(a){console.log(parse(a))}var path=require("path"),fs=require("fs");exports.command=function(){parsed=parseArguments(process.argv),run(parsed.source)};